webpackJsonp([0x27a8168686999a00],{"./node_modules/json-loader/index.js!./.cache/json/html-semantic-html-elements.json":function(e,t){e.exports={data:{markdownRemark:{html:'<h2>Semantic HTML Elements</h2>\n<p>The <code>&#x3C;em></code> element marks text as being emphasized above the text around it. Typically, the browser renders this in <em>italics</em>, but you can add other styles using CSS.</p>\n<p>HTML5 introduced new semantic elements such as <code>&#x3C;header></code> and <code>&#x3C;footer></code>. These elements function similarly to <code>&#x3C;div></code>, but give additional context to people and computers reading or parsing the code.</p>\n<h4><code>&#x3C;em></code> vs <code>&#x3C;i></code> vs <code>&#x3C;cite></code></h4>\n<p>Since webpages so often display <code>&#x3C;em></code> in <em>italics</em>, beginning developers may think <code>&#x3C;em></code> and <code>&#x3C;i></code> (which also renders text in <em>italics</em>) are interchangeable.</p>\n<p>While the visual result may be the same, the semantic meaning of the two tags is different. The <code>&#x3C;em></code> tag indicates that its content is emphasized, while the <code>&#x3C;i></code> tag represents text that is set apart from the surrounding text, such as with a foreign language, a fictional characterâ€™s thoughts, or the definition of a word. On the other hand, the title of a book, movie, musical composition, or another work should use the <code>&#x3C;cite></code> tag.</p>\n<p>A semantic element clearly describes its meaning to both the browser and the developer.</p>\n<p>Examples of non-semantic elements: <code>&#x3C;div></code> and <code>&#x3C;span></code> - Tells nothing about its content.</p>\n<p>Examples of semantic elements: <code>&#x3C;form></code>, <code>&#x3C;table></code>, and <code>&#x3C;article></code> - Clearly defines its content.</p>\n<h4>More Information:</h4>\n<p>For more information: <a href="https://codepen.io/mi-lee/post/an-overview-of-html5-semantics">https://codepen.io/mi-lee/post/an-overview-of-html5-semantics</a></p>\n<p>Refer to the <a href="https://developer.mozilla.org/en-US/docs/Web/HTML/Element/em">MDN Web Docs article</a>.</p>',fields:{slug:"/html/semantic-html-elements/"},frontmatter:{title:"Semantic HTML Elements"}}},pathContext:{slug:"/html/semantic-html-elements/"}}}});
